import React from "react";
import {Link} from "react-router-dom"
export default function NavBar()
{
    // display: flex;
    // max-height: 90px;
    // justify-content: space-between;
    // background-color: slategrey;
    // color: whitesmoke;
    let navStyle = {
        display: "flex",
        height: "100px",
        justifyContent: "space-between",
        backgroundColor: "slategrey",
        color: "whitesmoke",
        alignItems: "center",

    }
    let divStyle = {
        display: "flex",
        // flexDirection: "row-reverse",
        // float: "right",
    }
    let h3Style = {
        margin: "10px",
    }
    let aStyle = {
        color: "whitesmoke",
        textDecoration: "none",
    }
    return (
        <nav style = {navStyle}>
            <img className = "nav--logo" src="" alt="Logo"/>
            <div style={divStyle}>

                <Link to="/blogs" style = {h3Style}>Blogs</Link>

                <h3 style = {h3Style}><a style = {aStyle} href = "">Contacts</a></h3>
                <h3 style = {h3Style}><a style = {aStyle} href = "">About</a></h3>
            </div>

        </nav>
    )
}
